Living in a time when cultures and traditions are being forgotten  to give way to modern ways of life, a group of Green Hub graduates and have visually documented the Adam Damre Yullo. 

The Adam Damre Yullo is a ritual in Donyi polo which is practiced by the Nyishi tribe of Arunachal Pradesh. This Yullo or ritual is performed for prosperity, health and good fortune. 

We are delighted to share with you the trailer of the film that we are working towards.

 Congrats to the talented team for working on this brilliant project .
